      <img src={picture} className="mb-3 w-100" />
        <div className="text-muted small text-truncate">0F8JIqi4zwvb77FGz6Wt</div>
        <div className="h6 mt-2 mb-0 text-truncate">mr. Heinz-Georg Fiedler</div>
        <div className="text-muted text-truncate small">heinz-georg.fiedler@example.com</div>
        <div className="border-top mt-2 pt-2 text-left">
          <div className="out-a small pointer text-underline" >Get Full Profile</div>
          <div className="out-a small pointer text-underline" >Get Posts List</div>
        </div>
   </div>);
};

